"use strict";(globalThis.webpackChunksykim_project=globalThis.webpackChunksykim_project||[]).push([[6780],{1415:r=>{r.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/Index","metadata":{"permalink":"/sykim-project/Index","source":"@site/blog/Index.md","title":"Introduce","description":"Backend Engineer \xb7 \uae30\ub85d\ud558\ub294 \uc0ac\ub78c","date":"2025-12-15T04:15:27.000Z","tags":[],"readingTime":0.21,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Introduce"},"unlisted":false,"nextItem":{"title":"\uc774 \uae30\uc220\ube14\ub85c\uadf8\uc5d0\uc11c \uc55e\uc73c\ub85c \ub2e4\ub8f0 \ub0b4\uc6a9","permalink":"/sykim-project/2025/12/12/start-tech-blog"}},"content":"## Backend Engineer \xb7 \uae30\ub85d\ud558\ub294 \uc0ac\ub78c\\r\\n\\r\\n\ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc790\ub85c \uc77c\ud558\uba70 \ub9c8\uc8fc\ud55c \ubb38\uc81c\uc640 \uace0\ubbfc\uc744 \uae30\ub85d\ud569\ub2c8\ub2e4.\\r\\n\uae30\uc220\uc801\uc778 \uc8fc\uc81c\ubd80\ud130 \uc77c\uc758 \ubc29\uc2dd\uacfc \uc131\uc7a5\uc5d0 \ub300\ud55c \uc0dd\uac01\uae4c\uc9c0  \\r\\n\ucc28\ubd84\ud558\uac8c \uc815\ub9ac\ud558\ub294 \uacf5\uac04\uc785\ub2c8\ub2e4.\\r\\n\\r\\n---\\r\\n\\r\\n### \uc774 \ube14\ub85c\uadf8\uc5d0\uc11c \ub2e4\ub8e8\ub294 \ub0b4\uc6a9\\r\\n\\r\\n**Tech**  \\r\\n\uc124\uacc4, \ucf54\ub4dc, \ud2b8\ub7ec\ube14\uc288\ud305 \uae30\ub85d\\r\\n\\r\\n**Worklog**  \\r\\n\uc6b4\uc601, \uc7a5\uc560 \ub300\uc751, \ud611\uc5c5\uacfc \uc77c\uc758 \ubc29\uc2dd\\r\\n\\r\\n**Notes**  \\r\\n\uc77d\uace0 \ubc30\uc6b4 \uac83 \uc815\ub9ac"},{"id":"/2025/12/12/start-tech-blog","metadata":{"permalink":"/sykim-project/2025/12/12/start-tech-blog","source":"@site/blog/2025-12-12-start-tech-blog.md","title":"\uc774 \uae30\uc220\ube14\ub85c\uadf8\uc5d0\uc11c \uc55e\uc73c\ub85c \ub2e4\ub8f0 \ub0b4\uc6a9","description":"\uc774 \ube14\ub85c\uadf8\ub294 \ub2e8\uc21c\ud55c \uae30\uc220 \uc815\ub9ac \uacf5\uac04\uc774 \uc544\ub2c8\ub77c,","date":"2025-12-12T00:00:00.000Z","tags":[{"inline":true,"label":"\uae30\uc220\ube14\ub85c\uadf8","permalink":"/sykim-project/tags/\uae30\uc220\ube14\ub85c\uadf8"},{"inline":true,"label":"\ud3ec\ud2b8\ud3f4\ub9ac\uc624","permalink":"/sykim-project/tags/\ud3ec\ud2b8\ud3f4\ub9ac\uc624"},{"inline":true,"label":"\ubc31\uc5d4\ub4dc","permalink":"/sykim-project/tags/\ubc31\uc5d4\ub4dc"}],"readingTime":1.37,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"\uc774 \uae30\uc220\ube14\ub85c\uadf8\uc5d0\uc11c \uc55e\uc73c\ub85c \ub2e4\ub8f0 \ub0b4\uc6a9","tags":["\uae30\uc220\ube14\ub85c\uadf8","\ud3ec\ud2b8\ud3f4\ub9ac\uc624","\ubc31\uc5d4\ub4dc"]},"unlisted":false,"prevItem":{"title":"Introduce","permalink":"/sykim-project/Index"},"nextItem":{"title":"Batch \ub808\uac70\uc2dc \uc815\uc0b0 \uc2dc\uc2a4\ud15c \uace0\ub3c4\ud654","permalink":"/sykim-project/2025/12/12/tech/batch-modernization"}},"content":"\uc774 \ube14\ub85c\uadf8\ub294 \ub2e8\uc21c\ud55c \uae30\uc220 \uc815\ub9ac \uacf5\uac04\uc774 \uc544\ub2c8\ub77c,  \\r\\n**\uc2e4\ubb34\uc5d0\uc11c\uc758 \uace0\ubbfc\uacfc \uc120\ud0dd, \uadf8\ub9ac\uace0 \uadf8 \uacb0\uacfc\ub97c \uae30\ub85d\ud558\ub294 \uacf5\uac04**\uc73c\ub85c \uc6b4\uc601\ud560 \uc608\uc815\uc774\ub2e4.\\r\\n\\r\\n\ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc790\ub85c \uc77c\ud558\uba70 \ub290\ub080 \uc810\uc740,  \\r\\n\uae30\uc220 \uc790\uccb4\ubcf4\ub2e4\ub3c4 **\u201c\uc5b4\ub5a4 \uc0c1\ud669\uc5d0\uc11c \uc65c \uc774 \uc120\ud0dd\uc744 \ud588\ub294\uc9c0\u201d**\uac00 \ud6e8\uc52c \uc911\uc694\ud558\ub2e4\ub294 \uac83\uc774\ub2e4.  \\r\\n\uc774 \ube14\ub85c\uadf8\uc5d0\uc11c\ub294 \uadf8\ub7f0 \ud310\ub2e8\uc758 \ub9e5\ub77d\uc744 \uc911\uc2ec\uc73c\ub85c \uc815\ub9ac\ud574\ubcf4\ub824\uace0 \ud55c\ub2e4.\\r\\n\\r\\n---\\r\\n\\r\\n## 1. \uc815\uc0b0\xb7\uacb0\uc81c(PG) \uc2dc\uc2a4\ud15c \uc2e4\ubb34 \uae30\ub85d\\r\\n\\r\\n\uac00\uc7a5 \uc624\ub798 \ub2e4\ub904\uc628 \uc601\uc5ed\uc778 **\uc815\uc0b0\xb7\uacb0\uc81c(PG) \uc2dc\uc2a4\ud15c**\uc744 \uc911\uc2ec\uc73c\ub85c,  \\r\\n\ub2e4\uc74c\uacfc \uac19\uc740 \ub0b4\uc6a9\uc744 \uc815\ub9ac\ud560 \uacc4\ud68d\uc774\ub2e4.\\r\\n\\r\\n- \uc815\uc0b0 \uae30\uc900\uc815\ubcf4 \uc124\uacc4 (\uc218\uc218\ub8cc\uc728, \uacc4\uc0b0 \ubc29\uc2dd, \uc138\uae08\uacc4\uc0b0\uc11c \uae30\uc900)\\r\\n- \uc815\uc0b0 \ubc30\uce58 \uc2dc\uc2a4\ud15c \uc124\uacc4\uc640 \uace0\ub3c4\ud654 \uacfc\uc815\\r\\n- \uc815\uc0b0 \uc911\ubcf5 \ucc98\ub9ac\uc640 \ub370\uc774\ud130 \uc815\ud569\uc131 \ubb38\uc81c\\r\\n- PG/\uc678\ubd80 \uc2dc\uc2a4\ud15c \uc5f0\ub3d9 \uc2dc \uace0\ub824\ud574\uc57c \ud560 \ud3ec\uc778\ud2b8\\r\\n\\r\\n\uc2e4\uc81c \uc6b4\uc601 \ud658\uacbd\uc5d0\uc11c \uacaa\uc5c8\ub358 \ubb38\uc81c\uc640  \\r\\n\uadf8 \ubb38\uc81c\ub97c \ud574\uacb0\ud558\uae30 \uc704\ud574 \uc5b4\ub5a4 \uad6c\uc870\uc640 \ubc29\uc2dd\uc744 \uc120\ud0dd\ud588\ub294\uc9c0\ub97c \uae30\ub85d\ud55c\ub2e4.\\r\\n\\r\\n---\\r\\n\\r\\n## 2. Spring Batch \uae30\ubc18 \ub300\ub7c9 \ucc98\ub9ac\uc640 \uc131\ub2a5 \uac1c\uc120\\r\\n\\r\\n\ub300\ub7c9 \ub370\uc774\ud130 \ucc98\ub9ac\uc640 \ubc30\uce58\ub294 \uc815\uc0b0 \uc2dc\uc2a4\ud15c\uc5d0\uc11c \ube60\uc9c8 \uc218 \uc5c6\ub294 \uc601\uc5ed\uc774\ub2e4.\\r\\n\\r\\n- Chunk vs Tasklet \uc120\ud0dd \uae30\uc900\\r\\n- Skip / Retry \uc815\ucc45 \uc124\uacc4 \uacbd\ud5d8\\r\\n- \ub300\ub7c9 Insert / Update \uc131\ub2a5 \uac1c\uc120\\r\\n- \ubc30\uce58 \uc7a5\uc560 \ubc1c\uc0dd \uc2dc \uc7ac\ucc98\ub9ac \uc804\ub7b5\\r\\n\\r\\n\ub2e8\uc21c \uae30\ub2a5 \uc124\uba85\uc774 \uc544\ub2cc,  \\r\\n**\uc6b4\uc601 \uc548\uc815\uc131\uacfc \uc131\ub2a5\uc744 \ud568\uaed8 \uace0\ub824\ud55c \uc124\uacc4 \uad00\uc810**\uc744 \uc911\uc2ec\uc73c\ub85c \uc815\ub9ac\ud560 \uc608\uc815\uc774\ub2e4.\\r\\n\\r\\n---\\r\\n\\r\\n## 3. \ud2b8\ub79c\uc7ad\uc158, \ub3d9\uc2dc\uc131, \ub370\uc774\ud130 \uc815\ud569\uc131\\r\\n\\r\\n\uc2e4\ubb34\uc5d0\uc11c \uac00\uc7a5 \ub9ce\uc740 \uace0\ubbfc\uc774 \ud544\uc694\ud55c \uc8fc\uc81c \uc911 \ud558\ub098\ub2e4.\\r\\n\\r\\n- \ud2b8\ub79c\uc7ad\uc158 Isolation Level \uc120\ud0dd \uae30\uc900\\r\\n- Deadlock \ubc1c\uc0dd \uc6d0\uc778\uacfc \ub300\uc751 \uacbd\ud5d8\\r\\n- \ub3d9\uc2dc\uc131 \ucda9\ub3cc\uc744 \ub9c9\uae30 \uc704\ud55c \uc124\uacc4 \ubc29\uc2dd\\r\\n\\r\\n\uc774\ub860\ubcf4\ub2e4\ub294 **\uc2e4\uc81c \ubb38\uc81c \uc0c1\ud669\uacfc \uc120\ud0dd\uc758 \uacb0\uacfc**\ub97c \uc911\uc2ec\uc73c\ub85c \ub2e4\ub8ec\ub2e4.\\r\\n\\r\\n---\\r\\n\\r\\n## 4. \uc6b4\uc601, \uc7a5\uc560 \ub300\uc751, \uadf8\ub9ac\uace0 \uc790\ub3d9\ud654\\r\\n\\r\\n\uc11c\ube44\uc2a4\ub294 \uac1c\ubc1c\ubcf4\ub2e4 \uc6b4\uc601\uc5d0\uc11c \ub354 \ub9ce\uc740 \ubc30\uc6c0\uc744 \uc900\ub2e4.\\r\\n\\r\\n- \uc7a5\uc560 \uc54c\ub9bc \uc124\uacc4\\r\\n- \ub85c\uadf8\uc640 \uc774\ub825 \uae30\ubc18 \uc6d0\uc778 \ubd84\uc11d\\r\\n- \uc7ac\ucc98\ub9ac\uc640 \ub864\ubc31 \uc804\ub7b5\\r\\n- \uc6b4\uc601 \ud6a8\uc728\uc744 \ub192\uc774\uae30 \uc704\ud55c \uc790\ub3d9\ud654\\r\\n\\r\\n\u201c\uc7a5\uc560\ub97c \uc904\uc774\ub294 \ucf54\ub4dc\u201d\ubcf4\ub2e4  \\r\\n**\u201c\uc7a5\uc560\ub97c \ube68\ub9ac \ud30c\uc545\ud558\uace0 \ubcf5\uad6c\ud560 \uc218 \uc788\ub294 \uad6c\uc870\u201d**\uc5d0 \ub300\ud55c \uace0\ubbfc\uc744 \ub2f4\uc744 \uc608\uc815\uc774\ub2e4.\\r\\n\\r\\n\\r\\n---\\r\\n\\r\\n\uc774 \ube14\ub85c\uadf8\uc758 \uae00\ub4e4\uc740 \uc644\ubcbd\ud55c \uc815\ub2f5\uc744 \uc81c\uc2dc\ud558\uae30\ubcf4\ub2e4\ub294,  \\r\\n**\uc2e4\ubb34\uc5d0\uc11c \uace0\ubbfc\ud558\uace0 \uc120\ud0dd\ud588\ub358 \uacfc\uc815\uc744 \uc194\uc9c1\ud558\uac8c \uae30\ub85d**\ud558\ub294 \ub370 \ubaa9\uc801\uc774 \uc788\ub2e4.\\r\\n\\r\\n\uc55e\uc73c\ub85c \uc774 \uacf5\uac04\uc5d0 \uc313\uc77c \uae30\ub85d\ub4e4\uc774  \\r\\n\uc2a4\uc2a4\ub85c\ub97c \ub3cc\uc544\ubcf4\ub294 \uc790\ub8cc\uc774\uc790,  \\r\\n\ud544\uc694\ud55c \ub204\uad70\uac00\uc5d0\uac8c\ub294 \uc791\uc740 \ucc38\uace0\uac00 \ub418\uc5c8\uc73c\uba74 \ud55c\ub2e4."},{"id":"/2025/12/12/tech/batch-modernization","metadata":{"permalink":"/sykim-project/2025/12/12/tech/batch-modernization","source":"@site/blog/tech/2025-12-12-batch-modernization.md","title":"Batch \ub808\uac70\uc2dc \uc815\uc0b0 \uc2dc\uc2a4\ud15c \uace0\ub3c4\ud654","description":"Batch \ub808\uac70\uc2dc \uc815\uc0b0 \uc2dc\uc2a4\ud15c \uace0\ub3c4\ud654 \ubc29\ud5a5\uc131","date":"2025-12-12T00:00:00.000Z","tags":[{"inline":false,"label":"Tech","permalink":"/sykim-project/tags/tech","description":"\uc124\uacc4, \ucf54\ub4dc, \ud2b8\ub7ec\ube14\uc288\ud305"}],"readingTime":0.94,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Batch \ub808\uac70\uc2dc \uc815\uc0b0 \uc2dc\uc2a4\ud15c \uace0\ub3c4\ud654","tags":["tech"]},"unlisted":false,"prevItem":{"title":"\uc774 \uae30\uc220\ube14\ub85c\uadf8\uc5d0\uc11c \uc55e\uc73c\ub85c \ub2e4\ub8f0 \ub0b4\uc6a9","permalink":"/sykim-project/2025/12/12/start-tech-blog"}},"content":"## Batch \ub808\uac70\uc2dc \uc815\uc0b0 \uc2dc\uc2a4\ud15c \uace0\ub3c4\ud654 \ubc29\ud5a5\uc131\\r\\n1. select - insert \uad6c\uc870 \uae30\ubc18\uc73c\ub85c \uae30\uc900\uc815\ubcf4\uc640 \uac70\ub798\uc6d0\uc7a5 join\uc73c\ub85c \uc815\uc0b0 \uae30\uc900\uc815\ubcf4 \uc870\ud68c\uc640 \uacc4\uc0b0\ud558\ub294 \ub85c\uc9c1\uc73c\ub85c \uad6c\ud604 \ub428\\r\\n    -  Job \ub610\ub294 Step \uc2e4\ud589 \uc2dc, \uae30\uc900\uc815\ubcf4 \uce90\uc2f1 \uc870\ud68c -> \ucd94\ud6c4 Redis \uc5f0\ub3d9\\r\\n    - \uce90\uc2f1\ub41c \uae30\uc900\uc815\ubcf4\uc640 \uc815\uc0b0 \ub300 \uac70\ub798 \uc6d0\uc7a5\uc758 \uc815\uc0b0 \uc815\ubcf4 \uc0dd\uc131\\r\\n2. Domain Layer,  Batch Layer, Infra Layer \uacc4\uce35\uc73c\ub85c \uc7ac\uad6c\uc870\ud654\\r\\n    - \ub370\uc774\ud130 \uc815\ud569\uc131\uad00\ub828 \uc124\uacc4\\r\\n        - Table Unique Key\\r\\n3. Retry / Skip \uc815\ucc45\\r\\n    - Retry : \uc678\ubd80 \uc5f0\ub3d9 \uc2e4\ud328 \uc2dc\\r\\n    - Skip\\r\\n        - \uc815\ucc45 \uc815\uc758 \ud544\uc694\\r\\n            - \uae30\uc900\uc815\ubcf4 \ub204\ub77d\\r\\n            - \uac70\ub798\uae08\uc561 \uc624\ub958\\r\\n        - \uac01 \uc815\ucc45\uc758 Skip \uac74\uc218\uac00 \uc77c\uc815 \uc774\uc0c1\uc77c \uacbd\uc6b0, \uc624\ub958\ub85c \uac10\uc9c0 Fail\\r\\n        - Skip \ub0b4\uc5ed Table \uad00\ub9ac -> IMS \ud654\uba74 \uc870\ud68c -> \ud6c4\ucc98\ub9ac \uae30\ub2a5 -> Batch \ud638\ucd9c\\r\\n4. \uc7ac\ucc98\ub9ac\\r\\n    - \uac01 Job\ubcc4 \ud6c4\ucc98\ub9ac\ub97c \uc704\ud55c Key \uae30\ubc18\uc758 \ud30c\ub77c\ubbf8\ud130 \uc815\uc758\\r\\n5. Batch \uc2dc, \uc2e4\ud589\uacb0\uacfc \uc870\ud68c \ubc0f \ud6c4\ucc98\ub9ac \uae30\ub2a5\\r\\n6. \ud14c\uc2a4\ud2b8 \uae30\uac04\uc744 \ucd95\uc18c\ud558\uae30 \uc704\ud55c \ud14c\uc2a4\ud2b8 \ucf54\ub4dc \uc791\uc131\\r\\n    - \ud14c\uc2a4\ud2b8 \uc9c0\uc6d0\uc744 \uc704\ud55c \ud14c\uc2a4\ud2b8 \ucf54\ub4dc\\r\\n7. JPA VS mybatis/JDBC Cursor template\\r\\n\\r\\n| \uae30\ub2a5                 | \uae30\uc220          | \uc774\uc720                                                             |\\r\\n|:-------------------| :---------- | :------------------------------------------------------------- |\\r\\n| \ub3c4\uba54\uc778 \uaddc\uce59 \ucc98\ub9ac \uc18c\ub7c9 \uc870\ud68c    | JPA         | 1\ucc28 \uce90\uc2f1, \uc601\uc18d\uc131 \ucee8\ud14c\uc2a4\ud2b8 \uad00\ub9ac\ub85c \uc778\ud55c \uba54\ubaa8\ub9ac \uc0ac\uc6a9, Flush/clear \ube44\uc6a9 \ub4f1\uc73c\ub85c \uc778\ud55c \uc131\ub2a5 \uc800\ud558 \uac00\ub2a5\uc131 |\\r\\n| \ub300\ub7c9\uc758 \ub370\uc774\ud130 \uc870\ud68c(Reader) | JDBC Cursor | \uba54\ubaa8\ub9ac\uc5d0 \ud55c \ubc88\uc5d0 \uc62c\ub9ac\uc9c0 \uc54a\uace0 \uc2a4\ud2b8\ub9ac\ubc0d \ud615\ud0dc\ub85c \ubc1b\uc544\uc634                                  |\\r\\n| \ub300\ub7c9 Insert/Update   | JDBC+MERGE  | \ud55c \ubc88\uc758 \uac74\uc744 Chunk \ud2b8\ub79c\uc7ad\uc158 \ucee4\ubc0b \ub2e8\uc704\ub85c \ucc98\ub9ac                                   |"}]}}')}}]);